resources.string:
"మీ అనుమతితో, OnePlus ఉత్పత్తి రూపకల్పన మరియు వినియోగదారు అనుభవం మెరుగుపరచడానికి మీ ఫోన్ వాడుక సమాచారాన్ని సేకరిస్తుంది. మీరు వినియోగదారు అనుభవ ప్రోగ్రామ్ (“ప్రోగ్రామ్”) లో చేరడానికి ఆమోదించినట్లయితే, మీరు OnePlus కింది సమాచారాన్ని సేకరించి, ఉపయోగించి, విశ్లేషించవచ్చని మీరు అంగీకరిస్తున్నారు: 
 (1) కాన్ఫిగరేషన్ డేటా;
 (2) అప్లికేషన్ ప్రోగామ్ యొక్క గణాంకాల డేటా;
 (3) వినియోగదారు ప్రవర్తన డేటా;
 ఎగువ డేటాను సేకరించి, విశ్లేషించడం ద్వారా, OnePlus వినియోగదారు అనుభవాన్ని మెరుగుపరచడానికి పూనుకుంటుంది, అన్ని విధానాలు అనామకంగా జరుగుతాయి మరియు OnePlusకు ఎన్‌క్రిప్ట్ రూపంలో పంపబడతాయి, అంటే బ్యాటరీ సామర్థ్యం మరియు సిస్టమ్ స్థిరత్వాన్ని మెరుగుపరచడం వంటివి. ఈ డేటా ఏదైనా వ్యక్తిగత గుర్తింపు కోసం ఉపయోగించబడదు. మీరు ప్రోగ్రామ్‌లో చేరిన తర్వాత, మీరు కింది పద్ధతుల ద్వారా ఏ సమయంలోనైనా ఉపసంహరించుకోవచ్చు: సెట్టింగ్ – అధునాతనం – వినియోగదారు అనుభవ ప్రోగ్రామ్ మరియు పెట్టె ఎంపిక తీసివేయాలి. దయచేసి OnePlus ప్రాసెస్ చేసే సమాచారం గురించి మరింత తెలుసుకోవడానికి OnePlus గోప్యతా విధానాన్ని చూడండి. మీరు ప్రోగ్రామ్ నుండి ఉపశమరించుకున్నట్లయితే, OnePlus ఎగువ పేర్కొన్న మీ సమాచారాన్ని సేకరించడం ఆపివేస్తుంది."
